import { Component, OnInit } from '@angular/core';
import { CarService } from '../services/car.service';

@Component({
  selector: 'app-car-add',
  templateUrl: './car-add.page.html',
  styleUrls: ['./car-add.page.scss'],
})
export class CarAddPage implements OnInit {

  marca: string = '';
  modelo: string = '';
  precio: number = 0;
  descripcion: string = '';

  constructor(private carService: CarService) { }

  ngOnInit() {
  }

  addCar(){
    let car = {
      marca: this.marca,
      modelo: this.modelo,
      precio: this.precio,
      descripcion: this.descripcion
    }
    this.carService.add(car).subscribe(response =>{
      console.log("Oferta añadida");
    })
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>car-add</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-header collapse="condense">
    <ion-toolbar>
      <ion-title size="large">car-add</ion-title>
    </ion-toolbar>
  </ion-header>

  <ion-item>
    <ion-label position="floating">Marca</ion-label>
    <ion-input [(ngModel)]="marca" name="marca" type="text"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label position="floating">Modelo</ion-label>
    <ion-input [(ngModel)]="modelo" name="modelo" type="text"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label position="floating">Precio</ion-label>
    <ion-input [(ngModel)]="precio" name="precio" type="number"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label position="floating">Descripción</ion-label>
    <ion-textarea [(ngModel)]="descripcion" name="descripcion"></ion-textarea>
  </ion-item>

  <ion-button (click)="addCar()">Añadir Coche</ion-button>


</ion-content>
